import React, { useState } from 'react'
import Step from './products/Step'

const Table = ({ headerTitle, bodyTitle, more, classname, publish, changeShowStep, showStep }) => {




  const headerResult = headerTitle.map((el) => {
    return <td key={el.id}>{el.title}</td>
  })

  const bodyResult = bodyTitle.map((el, index) => {
    return <tr key={index}>
      <td><input type="checkbox" /></td>
      {
        el.map((e) => {
          return <td key={e.id} className={`TD-${e.id} ${e.state}`}>{e.title}</td>
        })
      }
      {
        publish &&
        <td className='publish'>
          <Step changeShowStep={changeShowStep} showStep={showStep} />
        </td>
      }
    </tr>
  })

  return (
    <div style={{ overflow: "auto" }}>
      <table className={`table-dashboard ${classname}`} >
        <thead>
          <tr>
            <td><input type="checkbox" /></td>
            {headerResult}
          </tr>
        </thead>
        <tbody>
          {bodyResult}
          {
            more &&
            <tr>
              <td className='table-more' colSpan="9">
                <a href='#' >المزيد من الطلبات</a>
              </td>
            </tr>
          }
        </tbody>
      </table>
    </div>
  )
}

export default Table;
